`,paraId:35,tocIndex:6},{value:"2.7",paraId:36,tocIndex:6},{value:" \u4F18\u5148\u4F7F\u7528\u5BF9\u8C61\u5C55\u5F00\u8FD0\u7B97\u7B26\u800C\u4E0D\u662F\u5BF9\u8C61\u6D45\u62F7\u8D1D",paraId:37,tocIndex:6},{value:"Object.assign",paraId:37,tocIndex:6},{value:". \u4F7F\u7528\u5BF9\u8C61\u5269\u4F59\u8FD0\u7B97\u7B26\u6765\u83B7\u5F97\u65B0\u7684\u6709\u5177\u4F53\u88AB\u7701\u7565\u5C5E\u6027\u7684\u5BF9\u8C61.",paraId:37,tocIndex:6},{value:`// very bad
const original = { a: 1, b: 2 };
const copy = Object.assign(original, { c: 3 }); // this mutates \`original\` \u0CA0_\u0CA0
delete copy.a; // so does this

// bad
const original = { a: 1, b: 2 };
const copy = Object.assign({}, original, { c: 3 }); // copy => { a: 1, b: 2, c: 3 }

// good
const original = { a: 1, b: 2 };
const copy = { ...original, c: 3 }; // copy => { a: 1, b: 2, c: 3 }

const { a, ...noA } = copy; // noA => { b: 2, c: 3 }
