`,paraId:179,tocIndex:15},{value:"11.6",paraId:180,tocIndex:15},{value:"\u4E0D\u5141\u8BB8\u51FA\u73B0\u672A\u88AB\u4F7F\u7528\u7684\u53D8\u91CF. eslint: ",paraId:181,tocIndex:15},{value:"no-unused-vars",paraId:181,tocIndex:15},{value:"\u539F\u56E0\uFF1A\u58F0\u660E\u4F46\u672A\u88AB\u4F7F\u7528\u7684\u53D8\u91CF\u901A\u5E38\u662F\u4E0D\u5B8C\u5168\u91CD\u6784\u72AF\u4E0B\u7684\u9519\u8BEF.\u8FD9\u79CD\u53D8\u91CF\u5728\u4EE3\u7801\u91CC\u6D6A\u8D39\u7A7A\u95F4\u5E76\u4F1A\u7ED9\u8BFB\u8005\u9020\u6210\u56F0\u6270.",paraId:182,tocIndex:15},{value:`// bad

