`,paraId:250,tocIndex:19},{value:"15.3",paraId:251,tocIndex:19},{value:"\u4EC5\u5F53\u547D\u540D\u6784\u9020\u51FD\u6570\u6216\u7C7B\u7684\u65F6\u5019\u4F7F\u7528\u5E15\u65AF\u5361\u98CE\u683C. eslint: ",paraId:252,tocIndex:19},{value:"new-cap",paraId:252,tocIndex:19},{value:`// bad
