`,paraId:257,tocIndex:19},{value:"15.5",paraId:258,tocIndex:19},{value:" \u4E0D\u8981\u4FDD\u5B58\u6307\u5411 ",paraId:259,tocIndex:19},{value:"this",paraId:259,tocIndex:19},{value:"\u7684\u5F15\u7528. \u4F7F\u7528\u7BAD\u5934\u51FD\u6570\u6216 ",paraId:259,tocIndex:19},{value:"\u51FD\u6570\u7684#bind",paraId:259,tocIndex:19},{value:".",paraId:259,tocIndex:19},{value:`// bad
