`,paraId:273,tocIndex:19},{value:"15.10",paraId:274,tocIndex:19},{value:" \u53EF\u4EE5\u5728\u4EE5\u4E0B\u60C5\u51B5\u628A\u4E00\u4E2A\u5E38\u91CF\u5168\u90E8\u5927\u5199(1) \u88AB\u5BFC\u51FA, (2) ",paraId:275,tocIndex:19},{value:"const",paraId:275,tocIndex:19},{value:"\u58F0\u660E\u7684 (\u4E0D\u80FD\u88AB\u91CD\u65B0\u8D4B\u503C), (3) \u5F00\u53D1\u8005 r \u8BA4\u4E3A\u8BE5\u53D8\u91CF(\u5185\u90E8\u5D4C\u5957\u7684\u5C5E\u6027)\u4E0D\u4F1A\u6539\u53D8.",paraId:275,tocIndex:19},{value:"\u539F\u56E0? \u8FD9\u5BF9\u4E8E\u5F00\u53D1\u8005\u4E0D\u786E\u5B9A\u53D8\u91CF\u662F\u5426\u4F1A\u6539\u53D8\u7684\u60C5\u5F62\u4E0B\u7684\u989D\u5916\u7684\u8F85\u52A9\u5DE5\u5177. UPPERCASE_VARIABLES \u80FD\u8BA9\u5F00\u53D1\u8005\u660E\u786E\u8BE5\u53D8\u91CF(\u548C\u5B83\u7684\u5C5E\u6027)\u65E0\u6CD5\u6539\u53D8.",paraId:276,tocIndex:19},{value:"\u6240\u6709\u7528",paraId:277,tocIndex:19},{value:"const",paraId:277,tocIndex:19},{value:" \u58F0\u660E\u7684\u53D8\u91CF\u5462? - \u6CA1\u5FC5\u8981\uFF0C\u6240\u4EE5\u4E00\u4E2A\u6587\u4EF6\u5185\u7684\u5E38\u91CF\u6CA1\u5FC5\u8981\u7528\u5927\u5199. \u7136\u800C\u5728\u5BFC\u51FA\u5E38\u91CF\u7684\u65F6\u5019\u5E94\u8BE5\u4F7F\u7528\u5927\u5199.",paraId:277,tocIndex:19},{value:"\u5BFC\u51FA\u7684\u5BF9\u8C61\u5462? - \u53EA\u5BF9\u5BFC\u51FA\u5BF9\u8C61\u7684\u9876\u5C42\u4F7F\u7528\u5927\u5199(\u5982 ",paraId:277,tocIndex:19},{value:"EXPORTED_OBJECT.key",paraId:277,tocIndex:19},{value:") \u4FDD\u8BC1\u5D4C\u5957\u7684\u5C5E\u6027\u90FD\u4E0D\u4F1A\u6539\u53D8.",paraId:277,tocIndex:19},{value:`// bad
const PRIVATE_VARIABLE =
  'should not be unnecessarily uppercased within a file';

// bad
