`,paraId:284,tocIndex:20},{value:"16.3",paraId:285,tocIndex:20},{value:"\u5982\u679C\u5C5E\u6027/\u65B9\u6CD5\u662F ",paraId:286,tocIndex:20},{value:"boolean",paraId:286,tocIndex:20},{value:", \u4F7F\u7528 ",paraId:286,tocIndex:20},{value:"isVal()",paraId:286,tocIndex:20},{value:" \u6216 ",paraId:286,tocIndex:20},{value:"hasVal()",paraId:286,tocIndex:20},{value:"\u65B9\u6CD5.",paraId:286,tocIndex:20},{value:`// bad
